const Table = ({ team, index }) => {
  // if (entries.length > 0) {
  //   entries[3].map(entry => console.log(entry));
  // }
  team.table.map(e => console.log(e.position));

  return (
    <section>
      <article className='table'>
        {team.table.map(e => <div className='table__position'>{e.position}</div>)}
        {team.table.map(e => <div className=''>{e.team.name}</div>)}
        {team.table.map(e => <div>{e.position}</div>)}
